import React from 'react';
import { LoginWrapper } from './style';
import Input from './../input';
const Login = props => {

    return (
        <LoginWrapper className="form-login-register login">
            <div className="container">
                <h3 className="name-form">
                    Đăng nhập
                </h3>
                <form className="form" action="" method>
                    <Input className="form-control" type="text" id="username" nameLabel="Username:" name="username" value="" placeholder="Username..." />
                    <Input className="form-control" type="password" id="pass" nameLabel="Password:" name="pass" value="" placeholder="Password..." />
                    <div className="submit-form">
                        <Input className="form control btn btn-success" name="submit" value="Login" type="submit" />
                        <div className="checkbox-rememberPass">
                            <Input type="checkbox" nameLabel="Nhớ mật khẩu"/>
                        </div>
                    </div>
                </form>
            </div>
        </LoginWrapper>
    );
}
export default Login;
